import React from 'react';
import { Link} from 'react-router-dom';

function HomePage(props) {
    return (
        <div>
            <Link to={{
            pathname:"/about",
            data:{
                Name:"Keshav Garg",
                Edu:"NITH"
            }
            }}>Banking System</Link>
        </div>
    );
}

export default HomePage;
